import React from 'react';

const BinaryTreeInformation = () => {
    return (
        <div className="information">
            <h1>Binary Tree</h1>
            <p>A Binary Tree is a data structure in which each element in the tree contains at most two children elements, a left and a right child. Each element in the tree is contained in a node. A node contains the value of an element, a pointer to the left child node, and a pointer to the right child node.</p>
        </div>
    );
}

export default BinaryTreeInformation;
